import React from 'react';
import { XYPlot, VerticalBarSeries } from 'react-vis';
import isDeepEqual from "react-fast-compare";

function BarChart(props) {
    return(
        <div key={props.data}>
            <XYPlot 
                height={props.height} 
                width={props.width}
            >
                <VerticalBarSeries
                key={props.data}
                    animation
                    data={props.data} 
                    colorType="literal"
                    barWidth={0.75}
                />
            </XYPlot>
        </div>
    );
};


const GraphDisplay = React.memo(props => <BarChart key={props.data} data={props.data} height={props.height} width={props.width} />, isDeepEqual);

export default GraphDisplay;
